import React, { useEffect, useState, useContext } from 'react';
import PropTypes from 'prop-types';

import withSendbirdContext from '../../lib/SendbirdSdkContext';
import { UserProfileProvider } from '../../lib/UserProfileContext';
import { LocalizationContext } from '../../lib/LocalizationContext';

import './index.scss';
import Badge from '../../ui/Badge';
import Label, { LabelTypography, LabelColors } from '../../ui/Label';
import Icon, { IconTypes, IconColors } from '../../ui/Icon';
import IconButton from '../../ui/IconButton';

import ChannelProfile from './components/ChannelProfile';
import MemebersAccordion from './components/MemebersAccordion';
import LeaveChannelModal from './components/LeaveChannel';
import AdminPanel from './components/AdminPanel';
import PlaceHolder from '../../ui/PlaceHolder';
import PlaceHolderTypes from '../../ui/PlaceHolder/type';
import { uuidv4 } from '../../utils/uuid';
import { createDefaultUserListQuery } from '../ChannelList/components/utils';

const COMPONENT_CLASS_NAME = 'sendbird-channel-settings';

const kFormatter = (num) => (
  Math.abs(num) > 999
    ? `${(Math.abs(num) / 1000).toFixed(1)}K`
    : num
);

function ChannelSettings(props) {
  const {
    className,
    onCloseClick,
    channelUrl,
    disableUserProfile,
    renderUserProfile,
    onChannelModified,
    renderChannelProfile,
    onBeforeUpdateChannel,
  } = props;

  const {
    stores: { sdkStore },
    config: {
      userListQuery,
      theme,
      userId,
      logger,
      isOnline,
    },
    queries = {},
  } = props;

  const { config = {} } = props;
  const userDefinedDisableUserProfile = disableUserProfile || config.disableUserProfile;
  const userDefinedRenderProfile = renderUserProfile || config.renderUserProfile;

  const userFilledApplicationUserListQuery = queries.applicationUserListQuery;
  const { stringSet } = useContext(LocalizationContext);

  const { sdk, initialized } = sdkStore;

  // hack to kepp track of channel updates by triggering useEffect
  const [channelUpdateId, setChannelUpdateId] = useState(uuidv4());
  const [channel, setChannel] = useState(null);
  const [invalidChannel, setInvalidChannel] = useState(false);
  const [showAccordion, setShowAccordion] = useState(false);
  const [showLeaveChannelModal, setShowLeaveChannelModal] = useState(false);

  const componentClassNames = (
    Array.isArray(className)
      ? [COMPONENT_CLASS_NAME, ...className]
      : [COMPONENT_CLASS_NAME, className]
  ).join(' ');

  useEffect(() => {
    logger.info('ChannelSettings: Setting up');
    if (!channelUrl || !initialized || !sdk) {
      logger.warning('ChannelSettings: Setting up failed', 'No channelUrl or sdk uninitialized');
      setInvalidChannel(false);
    } else {
      if (!sdk || !sdk.GroupChannel) {
        logger.warning('ChannelSettings: No GroupChannel');
        return;
      }
      sdk.GroupChannel.getChannel(channelUrl, (groupChannel) => {
        if (!groupChannel) {
          logger.warning('ChannelSettings: Channel not found');
          setInvalidChannel(true);
        } else {
          logger.info('ChannelSettings: Fetched group channel', groupChannel);
          setInvalidChannel(false);
          setChannel(groupChannel);
        }
      });
    }
  }, [channelUrl, initialized, channelUpdateId]);

  if (!channel || invalidChannel) {
    return (
      <div className={componentClassNames}>
        <div className="sendbird-channel-settings__header">
          <Label type={LabelTypography.H_2} color={LabelColors.ONBACKGROUND_1}>
            {stringSet.CHANNEL_SETTING__HEADER__TITLE}
          </Label>
          <Icon
            type={IconTypes.CLOSE}
            className="sendbird-channel-settings__close-icon"
            height="24px"
            width="24px"
            onClick={() => {
              logger.info('ChannelSettings: Click close');
              onCloseClick();
            }}
          />
        </div>
        <div>
          <PlaceHolder type={PlaceHolderTypes.WRONG} />
        </div>
      </div>
    );
  }

  return (
    <UserProfileProvider
      className={componentClassNames}
      disableUserProfile={userDefinedDisableUserProfile}
      renderUserProfile={userDefinedRenderProfile}
    >
      <div className="sendbird-channel-settings__header">
        <Label type={LabelTypography.H_2} color={LabelColors.ONBACKGROUND_1}>
          {stringSet.CHANNEL_SETTING__HEADER__TITLE}
        </Label>
        <div className="sendbird-channel-settings__header-icon">
          <IconButton
            width="32px"
            height="32px"
            onClick={() => {
              logger.info('ChannelSettings: Click close');
              onCloseClick();
            }}
          >
            <Icon
              type={IconTypes.CLOSE}
              className="sendbird-channel-settings__close-icon"
              height="22px"
              width="22px"
            />
          </IconButton>
        </div>
      </div>
      <div className="sendbird-channel-settings__scroll-area">
        {
          renderChannelProfile
            ? renderChannelProfile({ channel })
            : (
              <ChannelProfile
                disabled={!isOnline}
                channel={channel}
                userId={userId}
                theme={theme}
                onChannelInfoChange={(currentImg, currentTitle) => {
                  logger.info('ChannelSettings: Channel information being updated');
                  const swapParams = sdk.getErrorFirstCallback();
                  if (onBeforeUpdateChannel) {
                    const params = onBeforeUpdateChannel(currentTitle, currentImg, channel.data);
                    // swapParams
                    channel.updateChannel(params, (response, error) => {
                      let groupChannel = response;
                      if (swapParams) {
                        groupChannel = error;
                      }

                      onChannelModified(groupChannel);
                      setChannelUpdateId(uuidv4());
                    });
                    return;
                  }
                  channel.updateChannel(
                    currentTitle,
                    currentImg,
                    channel.data,
                    (response, error) => {
                      let groupChannel = response;
                      if (swapParams) {
                        groupChannel = error;
                      }
                      logger.info('ChannelSettings: Channel information updated', groupChannel);
                      onChannelModified(groupChannel);
                      setChannelUpdateId(uuidv4());
                    },
                  );
                }}
              />
            )
        }
        {
          channel.myRole === 'operator'
            ? (
              <AdminPanel
                channel={channel}
                userId={userId}
                onChannelModified={(groupChannel) => {
                  // setChannelUpdateId(uuidv4());
                  onChannelModified(groupChannel);
                }}
                userQueryCreator={
                  () => ((userListQuery && typeof userListQuery === 'function')
                    ? userListQuery()
                    : createDefaultUserListQuery({ sdk, userFilledApplicationUserListQuery })
                  )
                }
              />
            )
            : (
              <>
                {/* Move to different file */}
                <div
                  role="switch"
                  aria-checked={showAccordion}
                  tabIndex={0}
                  onKeyDown={() => setShowAccordion(!showAccordion)}
                  className={`
                    sendbird-channel-settings__panel-item
                    sendbird-channel-settings__members
                  `}
                  onClick={() => setShowAccordion(!showAccordion)}
                >
                  <Icon
                    type={IconTypes.MEMBERS}
                    className="sendbird-channel-settings__panel-icon-left"
                    height="24px"
                    width="24px"
                    fillColor={IconColors.PRIMARY}
                  />
                  <Label
                    type={LabelTypography.SUBTITLE_1}
                    color={LabelColors.ONBACKGROUND_1}
                  >
                    {`${stringSet.CHANNEL_SETTING__MEMBERS__TITLE}`}
                    <Badge count={kFormatter(channel.memberCount)} />
                  </Label>
                  <Icon
                    type={IconTypes.CHEVRON_RIGHT}
                    className={[
                      'sendbird-channel-settings__panel-icon-right',
                      'sendbird-channel-settings__panel-icon--chevron',
                      (showAccordion ? 'sendbird-channel-settings__panel-icon--open' : ''),
                    ].join(' ')}
                    height="24px"
                    width="24px"
                  />
                </div>
                {
                  showAccordion && (
                    <MemebersAccordion
                      currentUser={userId}
                      disabled={!isOnline}
                      // eslint-disable-next-line
                      userQueryCreator={
                        () => ((userListQuery && typeof userListQuery === 'function')
                          ? userListQuery()
                          : createDefaultUserListQuery({ sdk, userFilledApplicationUserListQuery })
                        )
                      }
                      swapParams={
                        sdk && sdk.getErrorFirstCallback && sdk.getErrorFirstCallback()
                      }
                      channel={channel}
                      members={channel.members}
                      onInviteMemebers={(selectedMemebers) => {
                        logger.info('ChannelSettings: Inviting new users');
                        channel.inviteWithUserIds(selectedMemebers)
                          .then((res) => {
                            onChannelModified(res);
                            setChannelUpdateId(uuidv4());
                            logger.info('ChannelSettings: Inviting new users success!', res);
                          });
                      }}
                    />
                  )
                }
              </>
            )
        }

        <div
          className={
            `sendbird-channel-settings__panel-item
              sendbird-channel-settings__leave-channel
              ${!isOnline ? 'sendbird-channel-settings__panel-item__disabled' : ''}`
          }
          role="button"
          tabIndex={0}
          disabled
          onKeyDown={() => {
            if (!isOnline) { return; }
            setShowLeaveChannelModal(true);
          }}
          onClick={() => {
            if (!isOnline) { return; }
            setShowLeaveChannelModal(true);
          }}
        >
          <Icon
            className={[
              'sendbird-channel-settings__panel-icon-left',
              'sendbird-channel-settings__panel-icon__leave',
            ].join(' ')}
            type={IconTypes.LEAVE}
            fillColor={IconColors.ERROR}
            height="24px"
            width="24px"
          />
          <Label
            type={LabelTypography.SUBTITLE_1}
            color={LabelColors.ONBACKGROUND_1}
          >
            {stringSet.CHANNEL_SETTING__LEAVE_CHANNEL__TITLE}
          </Label>
        </div>
        {
          showLeaveChannelModal && (
            <LeaveChannelModal
              onCloseModal={() => setShowLeaveChannelModal(false)}
              onLeaveChannel={() => {
                logger.info('ChannelSettings: Leaving channel', channel);
                channel.leave()
                  .then(() => {
                    logger.info('ChannelSettings: Leaving channel successful!', channel);
                    onCloseClick();
                  });
              }}
            />
          )
        }
      </div>
    </UserProfileProvider>
  );
}

ChannelSettings.propTypes = {
  className: PropTypes.oneOfType([
    PropTypes.string,
    PropTypes.arrayOf(PropTypes.string),
  ]),
  onCloseClick: PropTypes.func,
  onChannelModified: PropTypes.func,
  onBeforeUpdateChannel: PropTypes.func,
  renderChannelProfile: PropTypes.oneOfType([
    PropTypes.element,
    PropTypes.func,
  ]),
  disableUserProfile: PropTypes.bool,
  renderUserProfile: PropTypes.func,
  channelUrl: PropTypes.string.isRequired,
  queries: PropTypes.shape({
    applicationUserListQuery: PropTypes.shape({
      limit: PropTypes.number,
      userIdsFilter: PropTypes.arrayOf(PropTypes.string),
      metaDataKeyFilter: PropTypes.string,
      metaDataValuesFilter: PropTypes.arrayOf(PropTypes.string),
    }),
  }),
  // from withSendbirdContext
  stores: PropTypes.shape({
    sdkStore: PropTypes.shape({
      sdk: PropTypes.shape({
        getErrorFirstCallback: PropTypes.func,
        GroupChannel: PropTypes.oneOfType([
          PropTypes.shape({
            getChannel: PropTypes.func,
          }),
          PropTypes.func,
        ]),
        createApplicationUserListQuery: PropTypes.any,
      }),
      initialized: PropTypes.bool,
    }),
  }).isRequired,
  config: PropTypes.shape({
    userId: PropTypes.string,
    theme: PropTypes.string,
    userListQuery: PropTypes.func,
    isOnline: PropTypes.bool,
    logger: PropTypes.shape({
      info: PropTypes.func,
      error: PropTypes.func,
      warning: PropTypes.func,
    }),
  }).isRequired,
};

ChannelSettings.defaultProps = {
  className: '',
  onBeforeUpdateChannel: null,
  queries: {},
  disableUserProfile: false,
  renderUserProfile: null,
  renderChannelProfile: null,
  onCloseClick: () => { },
  onChannelModified: () => { },
};

export default withSendbirdContext(ChannelSettings);

import React, { useState, useRef, useContext } from 'react';
import PropTypes from 'prop-types';

import { LocalizationContext } from '../../../lib/LocalizationContext';
import Modal from '../../../ui/Modal';
import Input, { InputLabel } from '../../../ui/Input';
import Avatar from '../../../ui/Avatar/index';
import { Type as ButtonType } from '../../../ui/Button/type';
import Label, { LabelColors, LabelTypography } from '../../../ui/Label';
import TextButton from '../../../ui/TextButton';
import ChannelAvatar from '../../../ui/ChannelAvatar/index';

const EditDetails = (props) => {
  const {
    onSubmit,
    onCancel,
    channel,
    userId,
    theme,
  } = props;
  const inputRef = useRef(null);
  const formRef = useRef(null);
  const hiddenInputRef = useRef(null);
  const [currentImg, setCurrentImg] = useState(null);
  const [newFile, setNewFile] = useState(null);
  const { stringSet } = useContext(LocalizationContext);
  const title = channel.name;
  return (
    <Modal
      titleText={stringSet.MODAL__CHANNEL_INFORMATION__TITLE}
      submitText={stringSet.BUTTON__SAVE}
      onCancel={onCancel}
      onSubmit={() => {
        if (title !== '' && !inputRef.current.value) {
          if (formRef.current.reportValidity) { // might not work in explorer
            formRef.current.reportValidity();
          }
          return;
        }
        onSubmit(newFile, inputRef.current.value);
        onCancel();
      }}
      type={ButtonType.PRIMARY}
    >
      <form
        className="channel-profile-form"
        ref={formRef}
        onSubmit={(e) => { e.preventDefault(); }}
      >
        <div className="channel-profile-form__img-section">
          <InputLabel>
            {stringSet.MODAL__CHANNEL_INFORMATION__CHANNEL_IMAGE}
          </InputLabel>
          <div className="channel-profile-form__avatar">
            {
              currentImg
                ? (
                  <Avatar
                    height="80px"
                    width="80px"
                    src={currentImg}
                  />
                ) : (
                  <ChannelAvatar
                    height={80}
                    width={80}
                    channel={channel}
                    userId={userId}
                    theme={theme}
                  />
                )
              }
          </div>
          <input
            ref={hiddenInputRef}
            type="file"
            accept="image/gif, image/jpeg, image/png"
            style={{ display: 'none' }}
            onChange={(e) => {
              setCurrentImg(URL.createObjectURL(e.target.files[0]));
              setNewFile(e.target.files[0]);
              hiddenInputRef.current.value = '';
            }}
          />
          <TextButton
            className="channel-profile-form__avatar-button"
            onClick={() => hiddenInputRef.current.click()}
            notUnderline
          >
            <Label type={LabelTypography.BUTTON_1} color={LabelColors.PRIMARY}>
              {stringSet.MODAL__CHANNEL_INFORMATION__UPLOAD}
            </Label>
          </TextButton>
        </div>
        <div className="channel-profile-form__name-section">
          <InputLabel>
            {stringSet.MODAL__CHANNEL_INFORMATION__CHANNEL_NAME}
          </InputLabel>
          <Input
            required={title !== ''}
            name="channel-profile-form__name"
            ref={inputRef}
            value={title}
            placeHolder={stringSet.MODAL__CHANNEL_INFORMATION__INPUT__PLACE_HOLDER}
          />
        </div>
      </form>
    </Modal>
  );
};

EditDetails.propTypes = {
  onSubmit: PropTypes.func.isRequired,
  onCancel: PropTypes.func.isRequired,
  channel: PropTypes.shape({
    name: PropTypes.string,
  }).isRequired,
  userId: PropTypes.string.isRequired,
  theme: PropTypes.string.isRequired,
};

export default EditDetails;

import React, { useState, useContext } from 'react';
import PropTypes from 'prop-types';

import './channel-profile.scss';

import { LocalizationContext } from '../../../lib/LocalizationContext';
import Label, { LabelColors, LabelTypography } from '../../../ui/Label';
import EditDetailsModal from './EditDetails';
import TextButton from '../../../ui/TextButton';
import ChannelAvatar from '../../../ui/ChannelAvatar/index';

const ChannelProfile = (props) => {
  const {
    disabled,
    channel,
    userId,
    theme,
    onChannelInfoChange,
  } = props;
  const [showModal, setShowModal] = useState(false);
  const { stringSet } = useContext(LocalizationContext);

  const getChannelName = () => {
    if (channel && channel.name && channel.name !== 'Group Channel') {
      return channel.name;
    }
    if (channel && (channel.name === 'Group Channel' || !channel.name)) {
      return channel.members.map((member) => member.nickname || stringSet.NO_NAME).join(', ');
    }
    return stringSet.NO_TITLE;
  };

  return (
    <div className="sendbird-channel-profile">
      <div className="sendbird-channel-profile--inner">
        <div className="sendbird-channel-profile__avatar">
          <ChannelAvatar
            channel={channel}
            userId={userId}
            theme={theme}
            width={80}
            height={80}
          />
        </div>
        <Label
          className="sendbird-channel-profile__title"
          type={LabelTypography.SUBTITLE_2}
          color={LabelColors.ONBACKGROUND_1}
        >
          {getChannelName()}
        </Label>
        <TextButton
          disabled={disabled}
          className="sendbird-channel-profile__edit"
          onClick={() => {
            if (disabled) { return; }
            setShowModal(true);
          }}
          notUnderline
        >
          <Label
            type={LabelTypography.BUTTON_1}
            color={disabled ? LabelColors.ONBACKGROUND_2 : LabelColors.PRIMARY}
          >
            {stringSet.CHANNEL_SETTING__PROFILE__EDIT}
          </Label>
        </TextButton>
        {
          showModal && (
            <EditDetailsModal
              onCancel={() => setShowModal(false)}
              onSubmit={onChannelInfoChange}
              channel={channel}
              userId={userId}
              theme={theme}
            />
          )
        }
      </div>
    </div>
  );
};

ChannelProfile.propTypes = {
  channel: PropTypes.shape({
    name: PropTypes.string,
    members: PropTypes.arrayOf(
      PropTypes.shape({
        nickname: PropTypes.string,
      }),
    ),
  }).isRequired,
  userId: PropTypes.string.isRequired,
  theme: PropTypes.string,
  disabled: PropTypes.bool,
  onChannelInfoChange: PropTypes.func,
};

ChannelProfile.defaultProps = {
  theme: 'light',
  disabled: false,
  onChannelInfoChange: () => { },
};

export default ChannelProfile;

import React, {
  ReactElement,
  useEffect,
  useState,
} from 'react'

import { SendbirdTypes } from '../../../../types';

import Modal from '../../../../ui/Modal';
import UserListItem from '../../../../ui/UserListItem';
import IconButton from '../../../../ui/IconButton';
import Icon, { IconTypes, IconColors } from '../../../../ui/Icon';
import ContextMenu, { MenuItem, MenuItems } from '../../../../ui/ContextMenu';
import { noop } from '../../../../utils/utils';

interface Props {
  hideModal(): void;
  currentUser?: string;
  channel: SendbirdTypes["GroupChannel"];
}

export default function MembersModal({
  hideModal,
  channel,
  currentUser,
}: Props): ReactElement {
  const [members, setMembers] = useState([]);
  const [memberQuery, setMemberQuery] = useState(null);

  useEffect(() => {
    const memberListQuery = channel.createMemberListQuery();
    memberListQuery.limit = 20;
    memberListQuery.next((members, error) => {
      if (error) {
        return;
      }
      setMembers(members);
    });
    setMemberQuery(memberListQuery);
  }, [])
  return (
    <div>
      <Modal
        hideFooter
        onCancel={() => hideModal()}
        onSubmit={noop}
        titleText="All Members"
      >
        <div
          className="sendbird-more-members__popup-scroll"
          onScroll={(e) => {
            const { hasNext } = memberQuery;
            const target = e.target as HTMLTextAreaElement;
            const fetchMore = (
              target.clientHeight + target.scrollTop === target.scrollHeight
            );

            if (hasNext && fetchMore) {
              memberQuery.next((o, error) => {
                if (error) {
                  return;
                }
                setMembers([
                  ...members,
                  ...o,
                ])
              });
            }
          }}
        >
          { members.map((member) => (
            <UserListItem
              user={member}
              key={member.userId}
              currentUser={currentUser}
              action={({ parentRef, actionRef }) => (
                <>
                  {channel.myRole === 'operator' && (
                    <ContextMenu
                      menuTrigger={(toggleDropdown) => (
                        <IconButton
                          className="sendbird-user-message__more__menu"
                          width="32px"
                          height="32px"
                          onClick={toggleDropdown}
                        >
                          <Icon
                            width="24px"
                            height="24px"
                            type={IconTypes.MORE}
                            fillColor={IconColors.CONTENT_INVERSE}
                          />
                        </IconButton>
                      )}
                      menuItems={(closeDropdown) => (
                        <MenuItems
                          parentContainRef={parentRef}
                          parentRef={actionRef} // for catching location(x, y) of MenuItems
                          closeDropdown={closeDropdown}
                          openLeft
                        >
                          <MenuItem
                            onClick={() => {
                              if ((member.role !== 'operator')) {
                                channel.addOperators([member.userId], () => {
                                  setMembers(members.map(m => {
                                    if(m.userId === member.userId) {
                                      return {
                                        ...member,
                                        role: 'operator',
                                      };
                                    }
                                    return m;
                                  }));
                                  closeDropdown();
                                });
                              } else {
                                channel.removeOperators([member.userId], () => {
                                  setMembers(members.map(m => {
                                    if(m.userId === member.userId) {
                                      return {
                                        ...member,
                                        role: '',
                                      };
                                    }
                                    return m;
                                  }));
                                  closeDropdown();
                                });
                              }
                            }}
                          >
                            { member.role !== 'operator' ? 'Promote to operator' : 'Demote operator'}
                          </MenuItem>
                          {
                            // No muted members in broadcast channel
                            !channel.isBroadcast && (
                              <MenuItem
                                onClick={() => {
                                  if (member.isMuted) {
                                    channel.unmuteUser(member, () => {
                                      setMembers(members.map(m => {
                                        if(m.userId === member.userId) {
                                          return {
                                            ...member,
                                            isMuted: false,
                                          };
                                        }
                                        return m;
                                      }));
                                      closeDropdown();
                                    })
                                  } else {
                                    channel.muteUser(member, () => {
                                      setMembers(members.map(m => {
                                        if(m.userId === member.userId) {
                                          return {
                                            ...member,
                                            isMuted: true,
                                          };
                                        }
                                        return m;
                                      }));
                                      closeDropdown();
                                    });
                                  }
                                }}
                              >
                                { member.isMuted ? 'Unmute' : 'Mute' }
                              </MenuItem>
                            )
                          }
                          <MenuItem
                            onClick={() => {
                              channel.banUser(member, -1, '', () => {
                                setMembers(members.filter(({ userId }) => {
                                  return userId !== member.userId;
                                }));
                              });
                            }}
                          >
                            Ban
                          </MenuItem>
                        </MenuItems>
                      )}
                    />
                  )}
                </>
              )}
            />
          ))}
        </div>
      </Modal>
    </div>
  );
}

import React, { useState, useRef, useContext } from 'react';
import PropTypes from 'prop-types';

import './members-accordion.scss';

import { LocalizationContext } from '../../../lib/LocalizationContext';
import { UserProfileContext } from '../../../lib/UserProfileContext';
import Button from '../../../ui/Button';
import {
  Type as ButtonTypes,
  Size as ButtonSizes,
} from '../../../ui/Button/type';
import Avatar from '../../../ui/Avatar/index';
import Label, { LabelTypography, LabelColors } from '../../../ui/Label';
import InviteMembers from '../../InviteMembers';
import MembersModal from './AdminPanel/MembersModal';
import UserProfile from '../../../ui/UserProfile';
import ContextMenu, { MenuItems } from '../../../ui/ContextMenu';

const SHOWN_MEMBER_MAX = 10;

const UserListItem = ({ member = {}, currentUser = '' }) => {
  const avatarRef = useRef(null);
  const {
    disableUserProfile,
    renderUserProfile,
  } = useContext(UserProfileContext);
  const { stringSet } = useContext(LocalizationContext);
  return (
    <div className="sendbird-members-accordion__member">
      <div className="sendbird-members-accordion__member-avatar">
        <ContextMenu
          menuTrigger={(toggleDropdown) => (
            <Avatar
              onClick={() => {
                if (!disableUserProfile) {
                  toggleDropdown();
                }
              }}
              ref={avatarRef}
              src={member.profileUrl}
              width={24}
              height={24}
            />
          )}
          menuItems={(closeDropdown) => (
            <MenuItems
              openLeft
              parentRef={avatarRef}
              // for catching location(x, y) of MenuItems
              parentContainRef={avatarRef}
              // for toggling more options(menus & reactions)
              closeDropdown={closeDropdown}
              style={{ paddingTop: 0, paddingBottom: 0 }}
            >
              {
                renderUserProfile
                  ? renderUserProfile({
                    user: member,
                    currentUserId: currentUser,
                    close: closeDropdown,
                  })
                  : (
                    <UserProfile
