      {
        hasNext && (
          <div
            className="sendbird-channel-settings-accordion__footer"
          >
            <Button
              type={ButtonTypes.SECONDARY}
              size={ButtonSizes.SMALL}
              onClick={() => {
                setShowModal(true);
              }}
            >
              All banned members
            </Button>
          </div>
        )
      }
      {
        showModal && (
          <BannedMembersModal
            channel={channel}
            hideModal={() => {
              setShowModal(false);
              refreshList();
            }}
          />
        )
      }
    </>
  );
}

